import React, { Component } from "react";

export default class Contact extends Component {

	render() {

		return(
			<div>
			<p>You can email me at : enrico.zammitl@gmail.com or enricozl@protonmail.com or find me on LinkedIn.</p>
			</div>
		)
	}
}
